    "willamette-valley-enhancing-upland-prairie-on-william-l-finley-and-baskett-slough-nwr",nt"isopen":
    false,nt"url": null,nt"notes": "This project focused on treatments of two
    selected noxious weed species; meadow knapweed in oak savannah/upland prairie habitat
    at W.L. Finley NWR and tall oatgrass on high quality upland prairie occupied by
    Fenderu2019s blue butterfly at Baskett Slough NWR. Selective herbicide applications
    using several techniques were used as control measures for each species. Hand application
    with Milestone was the preferred for meadow knapweed control measure. Tall oatgrass
    treatments were primarily with specialized weed wiping applications in the late
    spring with glyphosate. Broadcast applications (multiple) with a grass specific
    herbicide (Fusilade) were applied to emerging tall oatgrass in the early spring.",nt"license_title":
